import React, { useState } from 'react';

const Login = ({ onSwitch }) => {
  const [formData, setFormData] = useState({ email: '', password: '' });
  const [showPassword, setShowPassword] = useState(false);
  const [errors, setErrors] = useState({});

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({ ...prev, [name]: value }));
    if (errors[name]) setErrors(prev => ({ ...prev, [name]: '' }));
  };

  const validate = () => {
    const newErrors = {};
    if (!formData.email) newErrors.email = 'Email is required';
    else if (!/\S+@\S+\.\S+/.test(formData.email)) newErrors.email = 'Email is invalid';
    if (!formData.password) newErrors.password = 'Password is required';
    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!validate()) return;
    // Placeholder: replace with real auth call
    console.log('Login submit', formData);
    alert('Logged in (dummy)');
  };

  return (
    <div className="min-h-screen flex items-center justify-center relative p-5">
      <div className="bg-white rounded-3xl shadow-2xl overflow-hidden flex max-w-4xl w-full min-h-[500px]">
        <div className="flex-1 p-16 flex items-center justify-center">
          <div className="w-full max-w-sm">
            <h2 className="text-3xl font-bold text-gray-800 mb-6 text-center">Sign in</h2>

            <form className="flex flex-col gap-6" onSubmit={handleSubmit}>
              <div className="flex flex-col gap-2">
                <div className="relative flex items-center">
                  <i className="fas fa-envelope absolute left-4 text-gray-400 z-10"></i>
                  <input
                    type="email"
                    name="email"
                    placeholder="Email Address"
                    value={formData.email}
                    onChange={handleInputChange}
                    className={`w-full pl-12 pr-4 py-4 border-2 rounded-xl text-base transition-all duration-300 box-border ${
                      errors.email ? 'border-red-500' : 'border-gray-200 focus:border-primary-500'
                    }`}
                  />
                </div>
                {errors.email && <span className="text-red-500 text-sm mt-1">{errors.email}</span>}
              </div>

              <div className="flex flex-col gap-2">
                <div className="relative flex items-center">
                  <i className="fas fa-lock absolute left-4 text-gray-400 z-10"></i>
                  <input
                    type={showPassword ? 'text' : 'password'}
                    name="password"
                    placeholder="Password"
                    value={formData.password}
                    onChange={handleInputChange}
                    className={`w-full pl-12 pr-12 py-4 border-2 rounded-xl text-base transition-all duration-300 box-border ${
                      errors.password ? 'border-red-500' : 'border-gray-200 focus:border-primary-500'
                    }`}
                  />
                  <button
                    type="button"
                    className="absolute right-4 bg-transparent border-none text-gray-400 cursor-pointer p-1"
                    onClick={() => setShowPassword(s => !s)}
                  >
                    <i className={`fas ${showPassword ? 'fa-eye-slash' : 'fa-eye'}`}></i>
                  </button>
                </div>
                {errors.password && <span className="text-red-500 text-sm mt-1">{errors.password}</span>}
              </div>

              <button type="submit" className="bg-gradient-to-r from-primary-500 to-primary-700 text-white py-4 rounded-xl font-semibold">Sign in</button>
            </form>

            <div className="text-center mt-6">
              <p className="text-gray-600 m-0">Not a member?{' '}
                <button type="button" onClick={() => onSwitch && onSwitch('signup')} className="text-primary-500 font-semibold bg-transparent border-none cursor-pointer p-0">Create account</button>
              </p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Login;
